import React, { useState } from 'react';
import { Search, Filter } from 'lucide-react';

const SearchBar = ({ onSearch, placeholder = "Search for clothing items...", showFilters = false }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [showFilterPanel, setShowFilterPanel] = useState(false);

  const handleSearch = (e) => {
    e.preventDefault();
    if (onSearch) {
      onSearch(searchTerm);
    }
  };

  const handleInputChange = (e) => {
    setSearchTerm(e.target.value);
    if (onSearch && e.target.value === '') {
      onSearch('');
    }
  };

  return (
    <div className="w-full">
      {/* Main Search Bar */}
      <form onSubmit={handleSearch} className="relative">
        <div className="relative">
          <div className="absolute inset-y-0 left-0 pl-4 flex items-center pointer-events-none">
            <Search className="h-5 w-5 text-secondary-400" />
          </div>
          <input
            type="text"
            value={searchTerm}
            onChange={handleInputChange}
            className="w-full pl-12 pr-20 py-4 text-lg border-2 border-secondary-200 rounded-xl focus:ring-2 focus:ring-primary-500 focus:border-transparent outline-none transition-all duration-200 bg-white shadow-sm"
            placeholder={placeholder}
          />
          <div className="absolute inset-y-0 right-0 flex items-center space-x-2 pr-3">
            {showFilters && (
              <button
                type="button"
                onClick={() => setShowFilterPanel(!showFilterPanel)}
                className="p-2 text-secondary-400 hover:text-primary-500 transition-colors"
              >
                <Filter className="h-5 w-5" />
              </button>
            )}
            <button
              type="submit"
              className="bg-primary-500 hover:bg-primary-600 text-white px-6 py-2 rounded-lg font-medium transition-colors duration-200"
            >
              Search
            </button>
          </div>
        </div>
      </form>

      {/* Secondary Filter Bar */}
      {showFilters && showFilterPanel && (
        <div className="mt-4 p-4 bg-secondary-50 rounded-lg">
          <div className="flex flex-wrap gap-3">
            <select className="px-3 py-2 border border-secondary-200 rounded-lg text-sm">
              <option>All Categories</option>
              <option>Tops</option>
              <option>Bottoms</option>
              <option>Dresses</option>
              <option>Outerwear</option>
            </select>
            <select className="px-3 py-2 border border-secondary-200 rounded-lg text-sm">
              <option>All Sizes</option>
              <option>XS</option>
              <option>S</option>
              <option>M</option>
              <option>L</option>
              <option>XL</option>
            </select>
            <select className="px-3 py-2 border border-secondary-200 rounded-lg text-sm">
              <option>All Conditions</option>
              <option>Like New</option>
              <option>Good</option>
              <option>Fair</option>
            </select>
            <select className="px-3 py-2 border border-secondary-200 rounded-lg text-sm">
              <option>Sort By</option>
              <option>Newest</option>
              <option>Price: Low to High</option>
              <option>Price: High to Low</option>
              <option>Most Popular</option>
            </select>
          </div>
        </div>
      )}
    </div>
  );
};

export default SearchBar;
